import React from 'react';
import "./Aboutus.css"
function Aboutus() {
  return <div className='About'>
      <div className='Aboutbox'>
      <div><h1>ABOUT US</h1></div>
      <div className='close'></div>
      <div></div>
      <input type="text"/>
      </div>
  </div>;
}

export default Aboutus;
